// convert to traditional chinese
function traditionalized(cc) {
  var str='';

  for(var i = 0; i < cc.length; i++){
    if(simpleStr.indexOf(cc.charAt(i)) != -1) {
      str += traditionalStr().charAt(simpleStr.indexOf(cc.charAt(i)));
    } else if(japaneseStr.indexOf(cc.charAt(i)) != -1) {
      str += traditionalStr().charAt(japaneseStr.indexOf(cc.charAt(i)));
    } else {
      str += cc.charAt(i);
    }
  }
  return str;
}

// convert to simple chinese
function simplized(cc) {
  var str='';

  for(var i = 0; i < cc.length; i++){
    if(traditionalStr.indexOf(cc.charAt(i)) != -1) {
      str += simpleStr.charAt(traditionalStr.indexOf(cc.charAt(i)));
    } else if(japaneseStr.indexOf(cc.charAt(i)) != -1) {
      str += simpleStr.charAt(japaneseStr.indexOf(cc.charAt(i)));
    }else {
      str += cc.charAt(i);
    }
  }
  return str;
}

// convert to japanese
function japanesed(cc) {
  var str='';

  for(var i = 0; i < cc.length; i++){
    if(traditionalStr.indexOf(cc.charAt(i)) != -1) {
      str += japaneseStr.charAt(traditionalStr.indexOf(cc.charAt(i)));
    } else if(simpleStr.indexOf(cc.charAt(i)) != -1) {
      str += japaneseStr.charAt(simpleStr.indexOf(cc.charAt(i)));
    }else {
      str += cc.charAt(i);
    }
  }
  return str;
}
